  const [loading, setloading] = useState(true);
  const [showData, setshowData] = useState(true);
  const navigate = useNavigate();
  return (
    <p>
      Employee Data
      <br />
      <Link to="/admin/addproduct">Add Product</Link>
    </p>
  );
}

export default Admin;
